INSERT INTO `config_info` VALUES (1, 'application-dev.yml', 'DEFAULT_GROUP', '# 项目相关配置\nlmf:\n  # 名称\n  name: Lmf\n  # 版本\n  version: 1.0.0\n  # 版权年份\n  copyrightYear: 2020\n  # 实例演示开关\n  demoEnabled: true\n  # 文件路径 示例（ Windows配置D:/lmf/uploadPath，Linux配置 /home/lmf/uploadPath）\n  profile: /home/lmf/uploadPath\n  # 获取ip地址开关\n  addressEnabled: false\n  # 验证码类型 math 数组计算 char 字符验证\n  captchaType: math\n\nspring:\n  main:\n    allow-bean-definition-overriding: true\n\n#请求处理的超时时间\nribbon:\n  ConnectTimeout: 20000\n  ReadTimeout: 20000\n  OkToRetryOnAllOperations: false\n  MaxAutoRetries: 2\n  MaxAutoRetriesNextServer: 1\n\n# feign 配置\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: false\n  httpclient:\n    enabled: true\n  client:\n    config:\n      default:\n        connectTimeout: 10000\n        readTimeout: 10000\n  compression:\n    request:\n      enabled: true\n    response:\n      enabled: true\n\n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n', 'bb224056ec9401c7c2b688190ac5b425', '2019-11-29 16:31:20', '2021-01-27 23:36:31', NULL, '127.0.0.1', '', '', '通用配置', 'null', 'null', 'yaml', 'null');
INSERT INTO `config_info` VALUES (10, 'sentinel-lmf-cloud-gateway', 'DEFAULT_GROUP', '[\n    {\n        \"resource\": \"lmf-cloud-auth\",\n        \"count\": 500,\n        \"grade\": 1,\n        \"limitApp\": \"default\",\n        \"strategy\": 0,\n        \"controlBehavior\": 0\n    },\n	{\n        \"resource\": \"lmf-cloud-system\",\n        \"count\": 1000,\n        \"grade\": 1,\n        \"limitApp\": \"default\",\n        \"strategy\": 0,\n        \"controlBehavior\": 0\n    },\n	{\n        \"resource\": \"lmf-cloud-uc\",\n        \"count\": 200,\n        \"grade\": 1,\n        \"limitApp\": \"default\",\n        \"strategy\": 0,\n        \"controlBehavior\": 0\n    },\n	{\n        \"resource\": \"lmf-cloud-wx\",\n        \"count\": 300,\n        \"grade\": 1,\n        \"limitApp\": \"default\",\n        \"strategy\": 0,\n        \"controlBehavior\": 0\n    }\n]', 'dc407cc31ca35080f14d16c9dc0e83be', '2021-01-12 02:21:22', '2021-01-27 22:31:35', NULL, '127.0.0.1', '', '', '', '', '', 'json', '');
INSERT INTO `config_info` VALUES (11, 'lmf-cloud-gateway-dev.yml', 'DEFAULT_GROUP', 'spring:\n  redis:\n    host: localhost\n    port: 6379\n    password: \n  cloud:\n    gateway:\n      discovery:\n        locator:\n          lowerCaseServiceId: true\n          enabled: true\n      routes:\n        # 认证中心\n        - id: lmf-cloud-auth\n          uri: lb://lmf-cloud-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            # 验证码处理\n            - CacheRequestFilter\n            - ValidateCodeFilter            \n            - StripPrefix=1\n        # 代码生成\n        - id: lmf-cloud-uc\n          uri: lb://lmf-cloud-uc\n          predicates:\n            - Path=/uc/**\n          filters:\n            - StripPrefix=1\n        # 微信模块\n        - id: lmf-cloud-wx\n          uri: lb://lmf-cloud-wx\n          predicates:\n            - Path=/wx/**\n          filters:\n            - StripPrefix=1\n        # 系统模块\n        - id: lmf-cloud-system\n          uri: lb://lmf-cloud-system\n          predicates:\n            - Path=/system/**\n          filters:\n            - StripPrefix=1\n        # 文件服务\n        - id: lmf-cloud-file\n          uri: lb://lmf-cloud-file\n          predicates:\n            - Path=/file/**\n          filters:\n            - StripPrefix=1\n        # 代码生成服务\n        - id: lmf-cloud-gen\n          uri: lb://lmf-cloud-gen\n          predicates:\n            - Path=/tool/**\n          filters:\n            - StripPrefix=1    \n\n# 不校验白名单\nignore:\n  whites:\n    - /auth/logout\n    - /auth/login\n    - /wx/front\n    - /uc/front\n    - /*/v2/api-docs\n    - /csrf\n', 'a35c4e1553eb36f519b349ab317b4657', '2021-01-12 02:38:22', '2021-01-28 22:33:31', NULL, '127.0.0.1', '', '', '', '', '', 'yaml', '');
INSERT INTO `config_info` VALUES (13, 'lmf-cloud-auth-dev.yml', 'DEFAULT_GROUP', 'spring: \n  redis:\n    host: localhost\n    port: 6379\n    password: \ndubbo:\n  # 配置服务信息\n  application:\n    name: ${spring.application.name}\n    # 禁用QOS同一台机器可能会有端口冲突现象\n    qos-enable: false\n    qos-accept-foreign-ip: false\n  # 配置注册中心\n  registry:\n    address: nacos://127.0.0.1:8848\n  # 设置超时时间\n  consumer:\n    timeout: 4000', '8a9548cf4dba25b894975edd46bc992b', '2021-01-12 02:47:03', '2021-01-19 22:21:38', NULL, '127.0.0.1', '', '', '', '', '', 'yaml', '');
