         # 慢SQL记录\n                    log-slow-sql: true\n                    slow-sql-millis: 1000\n                    merge-sql: true\n                wall:\n                    config:\n                        multi-statement-allow: true\ndubbo:\n  # 配置服务信息\n  application:\n    name: ${spring.application.name}\n    # 禁用QOS同一台机器可能会有端口冲突现象\n    qos-enable: false\n    qos-accept-foreign-ip: false\n  # 配置注册中心\n  registry:\n    address: nacos://127.0.0.1:8848\n  # 设置超时时间\n  consumer:\n    timeout: 4000', 'cff4ea023e6e0e14ba008c90ee1cbb86', '2021-01-28 22:28:03', '2021-01-28 22:28:50', NULL, '127.0.0.1', '', '', '', '', '', 'yaml', '');
