ge-sql: true\n                wall:\n                    config:\n                        multi-statement-allow: true\ndubbo:\n  # 配置服务信息\n  application:\n    name: ${spring.application.name}\n    # 禁用QOS同一台机器可能会有端口冲突现象\n    qos-enable: false\n    qos-accept-foreign-ip: false\n  # 配置注册中心\n  registry:\n    address: nacos://127.0.0.1:8848\n  # 设置超时时间\n  consumer:\n    timeout: 4000\n# swagger配置\nswagger:\n  title: 系统模块接口文档\n  license: Powered By ruoyi\n  licenseUrl: https://ruoyi.vip\n  authorization:\n    name: RuoYi OAuth\n    auth-regex: ^.*$\n    authorization-scope-list:\n      - scope: server\n        description: 客户端授权范围\n    token-url-list:\n      - http://localhost:8080/auth/oauth/token\n', '1a20a55c1fb88d755b899a8e24376014', '2021-01-27 15:54:03', '2021-01-27 01:54:03', NULL, '127.0.0.1', 'I', '');
