INSERT INTO `his_config_info` VALUES (175, 199, 'lmf-cloud-wx-dev.yml', 'DEFAULT_GROUP', '', 'wechat:\n  componentAppId: 22209871\n  componentAppSecret: osiajajshhhwpoqw\n  componentToken: poiejjdda\n  componentAesKey: 0lskhakajs\n# spring配置\nspring: \n  redis:\n    redisson:\n      config:\n        clusterServersConfig:\n          idleConnectionTimeout: 10000\n          connectTimeout: 10000\n          timeout: 3000\n          password: null\n          nodeAddresses:\n          - \"redis://localhost:6379\"    \n  datasource:\n        type: com.alibaba.druid.pool.DruidDataSource\n        driverClassName: com.mysql.cj.jdbc.Driver\n        url: jdbc:mysql://localhost:3306/lmf?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n        username: root\n        password: root\n        druid:            \n            # 初始连接数\n            initialSize: 5\n            # 最小连接池数量\n            minIdle: 10\n            # 最大连接池数量\n            maxActive: 20\n            # 配置获取连接等待超时的时间\n            maxWait: 60000\n            # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n            timeBetweenEvictionRunsMillis: 60000\n            # 配置一个连接在池中最小生存的时间，单位是毫秒\n            minEvictableIdleTimeMillis: 300000\n            # 配置一个连接在池中最大生存的时间，单位是毫秒\n            maxEvictableIdleTimeMillis: 900000\n            # 配置检测连接是否有效\n            validationQuery: SELECT 1 FROM DUAL\n            testWhileIdle: true\n            testOnBorrow: false\n            testOnReturn: false\n            webStatFilter: \n                enabled: true\n            statViewServlet:\n                enabled: true\n                # 设置白名单，不填则允许所有访问\n                allow:\n                url-pattern: /druid/*\n                # 控制台管理用户名和密码\n                login-username: abcd\n                login-password: poiu\n            filter:\n                stat:\n                    enabled: true\n                    # 慢SQL记录\n                    log-slow-sql: true\n                    slow-sql-millis: 1000\n                    merge-sql: true\n                wall:\n                    config:\n                        multi-statement-allow: true\ndubbo:\n  # 配置服务信息\n  application:\n    name: ${spring.application.name}\n    # 禁用QOS同一台机器可能会有端口冲突现象\n    qos-enable: false\n    qos-accept-foreign-ip: false\n  # 配置注册中心\n  registry:\n    address: nacos://127.0.0.1:8848\n  # 设置超时时间\n  consumer:\n    timeout: 4000\n# swagger配置\nswagger:\n  title: 系统模块接口文档\n  license: Powered By ruoyi\n  licenseUrl: https://ruoyi.vip\n  authorization:\n    name: RuoYi OAuth\n    auth-regex: ^.*$\n    authorization-scope-list:\n      - scope: server\n        description: 客户端授权范围\n    token-url-list:\n      - http://localhost:8080/auth/oauth/token\n', 'd49a2c237c13a9c1da74ff1762d040aa', '2021-01-27 17:22:49', '2021-01-27 03:22:49', NULL, '127.0.0.1', 'U', '');
INSERT INTO `his_config_info` VALUES (1, 200, 'application-dev.yml', 'DEFAULT_GROUP', '', '# 项目相关配置\nlmf:\n  # 名称\n  name: Lmf\n  # 版本\n  version: 1.0.0\n  # 版权年份\n  copyrightYear: 2020\n  # 实例演示开关\n  demoEnabled: true\n  # 文件路径 示例（ Windows配置D:/lmf/uploadPath，Linux配置 /home/lmf/uploadPath）\n  profile: /home/lmf/uploadPath\n  # 获取ip地址开关\n  addressEnabled: false\n  # 验证码类型 math 数组计算 char 字符验证\n  captchaType: math\n\nspring:\n  main:\n    allow-bean-definition-overriding: true\n\n#请求处理的超时时间\nribbon:\n  ReadTimeout: 10000\n  ConnectTimeout: 10000\n\n# feign 配置\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: true\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        connectTimeout: 10000\n        readTimeout: 10000\n  compression:\n    request:\n      enabled: true\n    response:\n      enabled: true\n\n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n', 'c57116bffbfdfc19436b99ad7fdd77bb', '2021-01-27 17:23:29', '2021-01-27 03:23:30', NULL, '127.0.0.1', 'U', '');
