INSERT INTO `his_config_info` VALUES (1, 274, 'application-dev.yml', 'DEFAULT_GROUP', '', '# 项目相关配置\nlmf:\n  # 名称\n  name: Lmf\n  # 版本\n  version: 1.0.0\n  # 版权年份\n  copyrightYear: 2020\n  # 实例演示开关\n  demoEnabled: true\n  # 文件路径 示例（ Windows配置D:/lmf/uploadPath，Linux配置 /home/lmf/uploadPath）\n  profile: /home/lmf/uploadPath\n  # 获取ip地址开关\n  addressEnabled: false\n  # 验证码类型 math 数组计算 char 字符验证\n  captchaType: math\n\nspring:\n  cloud:\n        loadbalancer:\n            retry:\n                enabled: false\n  main:\n    allow-bean-definition-overriding: true\n\n#请求处理的超时时间\nribbon:\n  ConnectTimeout: 20000\n  ReadTimeout: 20000\n  OkToRetryOnAllOperations: false\n  MaxAutoRetries: 2\n  MaxAutoRetriesNextServer: 1\n\n# feign 配置\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: false\n  httpclient:\n    enabled: true\n  client:\n    config:\n      default:\n        connectTimeout: 10000\n        readTimeout: 10000\n  compression:\n    request:\n      enabled: true\n    response:\n      enabled: true\n\n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n', '46b2ddbfa1b2f705e4bff428ea906acf', '2021-01-28 13:36:31', '2021-01-27 23:36:31', NULL, '127.0.0.1', 'U', '');
