INSERT INTO `his_config_info` VALUES (11, 297, 'lmf-cloud-gateway-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  redis:\n    host: localhost\n    port: 6379\n    password: \n  cloud:\n    gateway:\n      discovery:\n        locator:\n          lowerCaseServiceId: true\n          enabled: true\n      routes:\n        # 认证中心\n        - id: lmf-cloud-auth\n          uri: lb://lmf-cloud-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            # 验证码处理\n            - CacheRequestFilter\n            - ValidateCodeFilter            \n            - StripPrefix=1\n        # 代码生成\n        - id: lmf-cloud-uc\n          uri: lb://lmf-cloud-uc\n          predicates:\n            - Path=/uc/**\n          filters:\n            - StripPrefix=1\n        # 微信模块\n        - id: lmf-cloud-wx\n          uri: lb://lmf-cloud-wx\n          predicates:\n            - Path=/wx/**\n          filters:\n            - StripPrefix=1\n        # 系统模块\n        - id: lmf-cloud-system\n          uri: lb://lmf-cloud-system\n          predicates:\n            - Path=/system/**\n          filters:\n            - StripPrefix=1\n        # 文件服务\n        - id: lmf-cloud-file\n          uri: lb://lmf-cloud-file\n          predicates:\n            - Path=/file/**\n          filters:\n            - StripPrefix=1\n\n# 不校验白名单\nignore:\n  whites:\n    - /auth/logout\n    - /auth/login\n    - /wx/front\n    - /uc/front\n    - /*/v2/api-docs\n    - /csrf\n', 'f58e6a1fdb0dc772dcecf61a8cbb5da9', '2021-01-29 12:33:30', '2021-01-28 22:33:31', NULL, '127.0.0.1', 'U', '');
