INSERT INTO `his_config_info` VALUES (105, 313, 'lmf-cloud-system-dev.yml', 'DEFAULT_GROUP', '', '# spring配置\nspring: \n  redis:\n    host: localhost\n    port: 6379\n    password: \n  datasource:\n        type: com.alibaba.druid.pool.DruidDataSource\n        driverClassName: com.mysql.cj.jdbc.Driver\n        url: jdbc:mysql://localhost:3306/lmf?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n        username: root\n        password: root\n        druid:            \n            # 初始连接数\n            initialSize: 5\n            # 最小连接池数量\n            minIdle: 10\n            # 最大连接池数量\n            maxActive: 20\n            # 配置获取连接等待超时的时间\n            maxWait: 60000\n            # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n            timeBetweenEvictionRunsMillis: 60000\n            # 配置一个连接在池中最小生存的时间，单位是毫秒\n            minEvictableIdleTimeMillis: 300000\n            # 配置一个连接在池中最大生存的时间，单位是毫秒\n            maxEvictableIdleTimeMillis: 900000\n            # 配置检测连接是否有效\n            validationQuery: SELECT 1 FROM DUAL\n            testWhileIdle: true\n            testOnBorrow: false\n            testOnReturn: false\n            webStatFilter: \n                enabled: true\n            statViewServlet:\n                enabled: true\n                # 设置白名单，不填则允许所有访问\n                allow:\n                url-pattern: /druid/*\n                # 控制台管理用户名和密码\n                login-username: abcd\n                login-password: poiu\n            filter:\n                stat:\n                    enabled: true\n                    # 慢SQL记录\n                    log-slow-sql: true\n                    slow-sql-millis: 1000\n                    merge-sql: true\n                wall:\n                    config:\n                        multi-statement-allow: true\ndubbo:\n  # 配置服务信息\n  application:\n    name: ${spring.application.name}\n    # 禁用QOS同一台机器可能会有端口冲突现象\n    qos-enable: false\n    qos-accept-foreign-ip: false\n  # 配置注册中心\n  registry:\n    address: nacos://127.0.0.1:8848\n  # 设置超时时间\n  consumer:\n    timeout: 4000\n# swagger配置\nswagger:\n  title: 系统模块接口文档\n  license: Powered By ruoyi\n  licenseUrl: https://ruoyi.vip\n  authorization:\n    name: RuoYi OAuth\n    auth-regex: ^.*$\n    authorization-scope-list:\n      - scope: server\n        description: 客户端授权范围\n    token-url-list:\n      - http://localhost:8080/auth/oauth/token\n', '7f8debda69a8e887e1704a44dc66f390', '2021-01-29 17:30:33', '2021-01-29 03:30:33', NULL, '127.0.0.1', 'U', '');
